sh(4); // \u53EF\u4EE5\u4FEE\u6539\u6570\u7EC4\u5185\u5BB9\n  // numbers = []; // TypeError: Assignment to constant variable\n}\n\n// 4. \u5FAA\u73AF\u4E2D\u7684\u4F5C\u7528\u57DF\u95EE\u9898\n// var\u7684\u95EE\u9898\nfor (var i = 0; i < 3; i++) {\n  setTimeout(() => {\n    console.log('var:', i); // \u8F93\u51FA: 3, 3, 3\n  }, 100);\n}\n\n// let\u7684\u89E3\u51B3\u65B9\u6848\nfor (let i = 0; i < 3; i++) {\n  setTimeout(() => {\n    console.log('let:', i); // \u8F93\u51FA: 0, 1, 2\n  }, 100);\n}\n\n// 5. \u6682\u65F6\u6027\u6B7B\u533A\uFF08Temporal Dead Zone\uFF09\nfunction temporalDeadZoneExample() {\n  console.log(typeof x); // \"undefined\" (var)\n  // console.log(typeof y); // ReferenceError (let)\n  \n  var x = 1;\n  let y = 2;\n}\n\n// 6. \u5168\u5C40\u5BF9\u8C61\u5C5E\u6027\nvar globalVar = 'I am global';\nlet globalLet = 'I am also global';\nconst globalConst = 'I am global too';\n\nconsole.log(window.globalVar); // \"I am global\"\nconsole.log(window.globalLet); // undefined\nconsole.log(window.globalConst); // undefined\n"})})]}),(0,r.jsxs)(i.A,{value:"best-practices",label:"\u6700\u4F73\u5B9E\u8DF5",children:[(0,r.jsx)(e.h4,{id:"\u53D8\u91CF\u58F0\u660E\u6700\u4F73\u5B9E\u8DF5",children:"\u53D8\u91CF\u58F0\u660E\u6700\u4F73\u5B9E\u8DF5"}),(0,r.jsx)(e.pre,{children:(0,r.jsx)(e.code,{className:"language-javascript",metastring:'title="\u53D8\u91CF\u58F0\u660E\u6700\u4F73\u5B9E\u8DF5"',children:"// 1. \u4F18\u5148\u4F7F\u7528const\uFF0C\u9700\u8981\u91CD\u65B0\u8D4B\u503C\u65F6\u4F7F\u7528let\nconst API_URL = 'https://api.example.com';\nconst users = [];\nlet currentUser = null;\n\n// 2. \u907F\u514D\u4F7F\u7528var\n// \u4E0D\u63A8\u8350\nvar count = 0;\n\n// \u63A8\u8350\nlet count = 0;\n\n// 3. \u5728\u6700\u5C0F\u4F5C\u7528\u57DF\u5185\u58F0\u660E\u53D8\u91CF\nfunction processUsers(userList) {\n  const processedUsers = [];\n  \n  for (let i = 0; i < userList.length; i++) {\n    const user = userList[i];\n    \n    if (user.active) {\n      const processedUser = {\n        id: user.id,\n        name: user.name.toUpperCase(),\n        email: user.email.toLowerCase()\n      };\n      processedUsers.push(processedUser);\n    }\n  }\n  \n  return processedUsers;\n}\n\n// 4. \u4F7F\u7528\u6709\u610F\u4E49\u7684\u53D8\u91CF\u540D\n// \u4E0D\u63A8\u8350\nconst d = new Date();\nconst u = users.filter(x => x.a);\n\n// \u63A8\u8350\nconst currentDate = new Date();\nconst activeUsers = users.filter(user => user.active);\n\n// 5. \u5E38\u91CF\u4F7F\u7528\u5927\u5199\u5B57\u6BCD\u548C\u4E0B\u5212\u7EBF\nconst MAX_RETRY_COUNT = 3;\nconst API_ENDPOINTS = {\n  USERS: '/api/users',\n  POSTS: '/api/posts'\n};\n\n// 6. \u5BF9\u8C61\u548C\u6570\u7EC4\u7684\u4E0D\u53EF\u53D8\u64CD\u4F5C\nconst originalArray = [1, 2, 3];\n\n// \u4E0D\u63A8\u8350\uFF1A\u76F4\u63A5\u4FEE\u6539\u539F\u6570\u7EC4\noriginalArray.push(4);\n\n// \u63A8\u8350\uFF1A\u521B\u5EFA\u65B0\u6570\u7EC4\nconst newArray = [...originalArray, 4];\n\nconst originalObject = { name: 'John', age: 30 };\n\n// \u4E0D\u63A8\u8350\uFF1A\u76F4\u63A5\u4FEE\u6539\u539F\u5BF9\u8C61\noriginalObject.city = 'New York';\n\n// \u63A8\u8350\uFF1A\u521B\u5EFA\u65B0\u5BF9\u8C61\nconst newObject = { ...originalObject, city: 'New York' };\n"})})]})]}),"\n",(0,r.jsx)(e.h2,{id:"2-\u7BAD\u5934\u51FD\u6570\u4E0E\u51FD\u6570\u589E\u5F3A",children:"2. \u7BAD\u5934\u51FD\u6570\u4E0E\u51FD\u6570\u589E\u5F3A"}),"\n",(0,r.jsx)(e.h3,{id:"21-\u7BAD\u5934\u51FD\u6570\u8BED\u6CD5",children:"2.1 \u7BAD\u5934\u51FD\u6570\u8BED\u6CD5"}),"\n",(0,r.jsxs)(e.p,{children:["\u7BAD\u5934\u51FD\u6570\u662FES6\u5F15\u5165\u7684\u7B80\u6D01\u51FD\u6570\u8BED\u6CD5\uFF0C\u4E0D\u4EC5\u8BED\u6CD5\u66F4\u7B80\u6D01\uFF0C\u8FD8\u89E3\u51B3\u4E86\u4F20\u7EDF\u51FD\u6570\u4E2D",(0,r.jsx)(e.code,{children:"this"}),"\u7ED1\u5B9A\u7684\u95EE\u9898\u3002"]}),"\n",(0,r.jsx)(e.mermaid,{value:'graph LR\n    subgraph "\u7BAD\u5934\u51FD\u6570\u7279\u6027"\n        A[\u7B80\u6D01\u8BED\u6CD5] --\x3e B[\u8BCD\u6CD5this\u7ED1\u5B9A]\n      